    SET v_Sort = 'ModifiedDate DESC';
  END IF;

  -- Gán biến @filterQuery
  IF v_Limit = -1 THEN
    SET @filterQuery = CONCAT('SELECT * FROM employee WHERE ', v_Where, ' ORDER BY ', v_Sort);
  ELSE
    SET @filterQuery = CONCAT('SELECT * FROM employee WHERE ', v_Where, ' ORDER BY ', v_Sort, ' LIMIT ', v_Limit, ' OFFSET ', v_Offset);
  END IF;

  -- filterQuery và @filterQuery có ý nghĩa khác nhau
